import React from 'react';
import { useAsync } from "react-async"
import VesselListPresenter from './VesselListPresenter';
import apiService from '../../service/apiService.js';
// import {connect} from 'react-redux';

const VesselListContainer = () => {
    const { data: vesselList, error, isLoading } = useAsync({ promiseFn: apiService.callVesselList });

    return (
        <VesselListPresenter
            vesselList={vesselList}
        />
    );
};

// function getVesslList(state) {
    
// }

// export default connect(getVesslList)(VesselListContainer);
export default VesselListContainer;
